import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <nav class="navbar navbar-light bg-light">
      <a class="navbar-brand" href="#">
        Vidly
      </a>
      <a class="nav-item nav-link" href="#">
        Movies
      </a>
    </nav>
  );
};

export default NavBar;
